import { useState,useEffect } from "react";
import axios from "axios";


const Index=()=>{
    const [user,setUsername] = useState('');
    const [pass,setPassword] = useState('');
    const body={
        username : user,
        password : pass
    }

    const login=async()=>{
        const result = await axios.post(`http://localhost:80/auth/login`,body);
        console.log("Result = ",JSON.stringify(result));
    }

    useEffect(()=>{
        login()
    },[])

    return(
        <div>
            <h1>JWT Token with React</h1>
            <div>
               Email : <input type="text" onChange={(e)=>setUsername(e.target.value)} />
                Password : <input type="text" onChange={(e)=>setPassword(e.target.value)} />
            </div>
            <button onClick={login}>Login</button>
            {username} : {password}
        </div>
    )
}

export default Index;
